import React from 'react';

const Header = () => {
  return (
    <header className="bg-gray-800 text-white p-6 flex items-center justify-between">
      <h1 className="text-2xl font-medium">My App</h1>
      <nav className="flex items-center">
        <a href="idols" className="px-3 py-2 rounded-md text-sm font-medium leading-5 text-white bg-indigo-800 hover:bg-indigo-600 mr-4">Idol List</a>
        <a href="about" className="px-3 py-2 rounded-md text-sm font-medium leading-5 text-white bg-indigo-800 hover:bg-indigo-600">About This Site</a>
      </nav>
    </header>
  )
}

export default Header;
